function App(props){
    return(
        <div>
       <p>
        Name:{props.name}<br/>
        city:{props.city}<br/>
        age:{props.age}<br/>
        state:{props.state}
       </p>
        </div>
    )

}

function Prop(){
    return(
        <div>
      <App name="vijay" city="Banglore" age="25" state="Karanatak"/>
        </div>
    )
}

export default Prop;
